Our cameras recently caught up with Phat Geez, one of Philadelphia's fastest rising new rappers, in the studio where he spoke to us about his new mixtape 'Cut From A Different Cloth 2', his collaboration, with Kur, "All Love", and his upcoming ventures before previewing new music from the tape. 

One of the flamers that Phat Geez was gracious enough to let us hear was "Take Over": an aggressive riot starter of a track from 'CFDC 2', which is available now. 

